import React from 'react'
import { Link } from 'react-router-dom'

const Menu = () => {
  return (
    <>
    <Link to='/'>About</Link>
    <Link to="/contact">Contact</Link>
        {/* <a href='/'>About Us</a>
        <a href='/contact'>Contact</a> */}
    </>
  )
}

export default Menu
